import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Navbar from './Navbar';
import './App.css';

function App() {
  return (
    <BrowserRouter> 
      <div className="App">
        <Navbar />
        <Route path=""></Route>
      </div>
    </BrowserRouter>
  );
}

export default App;
